<h1>Randomizer</h1>

<div>Select a game:</div>
<select id="game">
    <option value="DDR">DDR</option>
    <option value="ITG">ITG</option>
    <option value="IIDX">IIDX</option>
    <option value="pop'n">pop'n</option>
    <option value="jubeat">jubeat</option>
    <option value="SDVX">SDVX</option>
    <option value="TECHNIKA">TECHNIKA</option>
    <option value="GF">GF</option>
    <option value="DM">DM</option>
    <option value="ReRave">ReRave</option>
</select>

<div id="roundSelect">
    <div id="roundCap">
        <div>What round is this?</div>
        <select id="roundCapSelector">
            <option value="first">First</option>
            <option value="second">Second</option>
            <option value="other">Third and beyond</option>
        </select>
    </div>
</div>

<div>
    <button id="randomize">Random five songs!</button>
</div>

<div id="results">
    <div id="results-1" class="vetoable"></div>
    <div id="results-2" class="vetoable"></div>
    <div id="results-3" class="vetoable"></div>
    <div id="results-4" class="vetoable"></div>
    <div id="results-5" class="vetoable"></div>
</div>

<script type="text/javascript">
    function getFormattedSongList(rawSongList) {
        var separatedSongList = rawSongList.split('\n'),
            formattedSongList = [];

        for(var i = 0; i < separatedSongList.length; i++) {
            var information = separatedSongList[i].split(','),
                songName = information[0],
                difficulty = information[1],
                rating = information[2];

            formattedSongList.push({ songName: songName, difficulty: difficulty, rating: rating });
        }

        return formattedSongList;
    };

    function getSelectedGame() {
        return $("#game").find("option:selected").text();
    }

    function isFirstRound() {
        return $("#roundCapSelector").find("option:selected").text() === "First";
    }

    function isSecondRound() {
        return $("#roundCapSelector").find("option:selected").text() === "Second";
    }

    function getRandomSongs(songList, lowCap, highCap, difficulty) {
        if(difficulty === "None") {
        	var randomedSongs = [],
            validSongs = songList.filter(function(song) {
                return song.rating <= highCap && song.rating >= lowCap;
            });
        }
        else {
        	var randomedSongs = [],
            validSongs = songList.filter(function(song) {
                return song.rating <= highCap && song.rating >= lowCap && difficulty.indexOf(song.difficulty) > -1;
            });
        }

        
        
        for(var i = 0; i < 5; i++) {
            var randomIndex = Math.floor(Math.random()*validSongs.length);
            randomedSongs.push(validSongs[randomIndex]);
            validSongs.splice(randomIndex, 1);
        }

        return randomedSongs;
    }

    function getQuals(songList, lowCap, highCap) {
        var validSongs = songList.filter(function(song) {
            return song.rating <= highCap && song.rating >= lowCap;
        });

        return validSongs;
    }

    $("#randomize").click(function() {
        var selectedGame = getSelectedGame(),
            associatedSongList,
            lowCap,
            highCap;

        for(var i = 0; i < 5; i++) {
            $("#results-" + (i+1)).empty();
            $("#results-" + (i+1)).css("text-decoration", "none");
        }

        difficulty = "None"

        switch(selectedGame) {
            case "DDR":
                associatedSongList = DDRSongList;

                if(isFirstRound()) {
                    lowCap = 8;
                    highCap = 15;
                }
                else if(isSecondRound()) {
                    lowCap = 10;
                    highCap = 17;
                }
                else {
                    lowCap = 12;
                    highCap = 19;
                    difficulty = ["Expert", "Challenge"]
                }

                break;
            case "ITG":
                associatedSongList = ITGSongList;

                if(isFirstRound()) {
                    lowCap = 9;
                    highCap = 11;
                }
                else if(isSecondRound()) {
                    lowCap = 9;
                    highCap = 12;
                }
                else {
                    lowCap = 10;
                    highCap = 15;
                    difficulty = ["Expert"]
                }

                break;

                    highCap = 10;
                }

                    lowCap = 9;
                    highCap = 11;
                }

                    lowCap = 10;
                    highCap = 12;
                    difficulty = ["Another"]
                }

                    highCap = 45;
                }

                    difficulty = ["Another"]
                }

                    lowCap = 9;
                    highCap = 14;

                    lowCap = 10;
                    highCap = 15;
                    difficulty = ["Exhaust"]
